ort java.util.Scanner;\r\n\r\nclass TestLinked \r\n{\r\n\r\n	public static void main(String[] args) \r\n	{\r\n		Linked ll=new Linked();\r\n		Scanner sc=new Scanner(System.in);\r\n	\r\n		\r\n		while(true)\r\n		{\r\n			String s=sc.next();\r\n			\r\n			switch(s)\r\n			{\r\n			 \r\n			case \"AB\":\r\n				     int ele=sc.nextInt();\r\n				     ll.AB(ele);\r\n				     break;\r\n			case \"PR\":\r\n				     ll.traverse();\r\n				     break;\r\n			case \"AE\":\r\n				     ele=sc.nextInt();\r\n					 ll.AE(ele);\r\n				     break;\r\n			case \"AMA\":\r\n				      ele=sc.nextInt();\r\n				     int ele1=sc.nextInt();\r\n				     ll.AMA(ele, ele1);\r\n				     break;\r\n			case \"AMB\":\r\n				      ele=sc.nextInt();\r\n			          ele1=sc.nextInt();\r\n			          ll.amb(ele, ele1);\r\n			          break;\r\n			case \"DN\":\r\n				      ele=sc.nextInt();\r\n				      ll.DN(ele);\r\n				      break;\r\n			case \"DNA\":\r\n				 	  ele=sc.nextInt();\r\n				 	  ll.DNA(ele);\r\n				 	  break;\r\n			case \"EXIT\":\r\n				     System.exit(0);\r\n				}			\r\n		}\r\n	\r\n	}\r\n\r\n}\r\n\r\n\r\n\r\nclass Node\r\n{\r\n	int data;\r\n	Node next;\r\n	\r\n	public Node(int data)\r\n	{\r\n		this.data=data;\r\n		this.next=null;\r\n	}\r\n}\r\n\r\nclass Linked\r\n{\r\n	Node head=null;\r\n	\r\n	public void AB(int ele)\r\n	{\r\n		Node node=new Node(ele);\r\n		node.next=head;\r\n		head=node;\r\n	}\r\n	\r\n	public void AE(int ele)\r\n	{\r\n		Node node=new Node(ele);\r\n		if(head==null)\r\n		{\r\n			head=node;\r\n		}\r\n		else\r\n		{\r\n			Node curr=head;\r\n			while(curr.next!=null)\r\n			{\r\n				curr=curr.next;\r\n			}\r\n			curr.next=node;\r\n		}\r\n	}\r\n	\r\n	public void AMA(int ele,int ele1)\r\n	{\r\n		Node node=new Node(ele1);\r\n		Node curr=head;\r\n		while(curr.next!=null)\r\n		{\r\n			if(curr.data==ele)\r\n			{\r\n				node.next=curr.next;\r\n				curr.next=node;\r\n				break;\r\n			}\r\n			curr=curr.next;  // node jumping\r\n		}\r\n		curr.next=node;\r\n	}\r\n	\r\n	public void amb(int ele,int ele1)\r\n	{\r\n		Node node=new Node(ele1);\r\n		Node curr=head;\r\n		Node prev=null;\r\n		if(head.data==ele)\r\n		{\r\n			node.next=head;\r\n			head=node;\r\n		}\r\n		else\r\n		{\r\n			while(curr.next!=null)\r\n			{\r\n				if(curr.data==ele)\r\n				{\r\n					node.next=curr;\r\n					prev.next=node;\r\n					break;\r\n				}\r\n				prev=curr;\r\n				curr=curr.next;\r\n			}\r\n			node.next=curr;                        //to add node before end node in Linked\r\n			prev.next=node;\r\n		}\r\n	}\r\n	\r\n	public void DN(int ele)\r\n	{\r\n		Node curr=head;\r\n		Node prev=null;\r\n		if(head.data==ele)\r\n		{\r\n			head=head.next;\r\n		}\r\n		else\r\n		{\r\n			while(curr.next!=null)\r\n			{\r\n				if(curr.data==ele)\r\n				{\r\n					prev.next=curr.next;\r\n					break;\r\n				}\r\n				prev=curr;\r\n				curr=curr.next;\r\n			}\r\n			prev.next=curr.next;\r\n		}\r\n	}\r\n	\r\n	public void DNA(int ele)\r\n	{\r\n		Node curr=head;\r\n		Node prev=null;\r\n		\r\n		while(curr.next!=null)\r\n		{\r\n			if(curr.data==ele)\r\n			{\r\n				prev=curr;\r\n				curr=curr.next;\r\n				prev.next=curr.next;\r\n				break;\r\n			}\r\n			 prev=curr;\r\n			 curr=curr.next;\r\n		}\r\n	}\r\n	\r\n	public void traverse()\r\n	{\r\n		Node curr=head;\r\n		while(curr.next!=null)\r\n		{\r\n			System.out.print(curr.data+\" \");\r\n			curr=curr.next;\r\n		}\r\n		System.out.println(curr.data);\r\n	}\r\n	\r\n	\r\n}','TestLLinked.java','application/octet-stream'),('c84f09f6-7e57-4433-a159-4136986767be',_binary '<!DOCTYPE html>\r\n<html>\r\n<body>\r\n\r\n<script>\r\nconst arr=[];\r\n\r\nfunction arradd() \r\n{\r\n   var c = document.getElementById(\"t1\").value;\r\n   if(arr.includes(c) == true){\r\n      alert(\"value already exists\");\r\n    }\r\n    else{\r\n      arr.push(c);\r\n   document.getElementById(\"ar1\").innerHTML = arr;\r\n    }\r\n\r\n}\r\n\r\nfunction arrdelete(){\r\n  for( var i = 0; i < arr.length; i++){ \r\n      if(arr[i] === document.getElementById(\"t2\").value) { \r\n                 arr.splice(i,1);\r\n            }\r\n  }\r\n  document.getElementById(\"ar1\").innerHTML = arr;\r\n}\r\n</script>\r\n\r\n<input type=\"text\" id=\"t1\"/><br>\r\n<input type=\"text\" id=\"t2\"/><br>\r\n<button onclick=\"arradd()\">Add</button>\r\n<button onclick=\"arrdelete()\">Remove</button>\r\n  <p id=\"ar1\"></p>\r\n\r\n</body>\r\n</html>','vaib.html','text/html');
